import React from "react";

const Container = (props) => {
  return (
    <div>
      <ol className="a">
        {props.todo.map((todo, index) => (
          <li
            style={{ backgroundColor: todo.isComplete ? "green" : "red" }}
            className="listItem"
            key={index}
          >
            <div className="yaziSilme">
              <span>{todo.text}</span>
              <button
                key={index}
                className="delete"
                onClick={() => handleDelete(index)}
              >
                Delete
              </button>
            </div>
          </li>
        ))}
      </ol>
    </div>
  );
};
export default Container;
